-- ----------------------------
-- Table structure for trademark
-- ----------------------------
DROP TABLE IF EXISTS `trademark`;
CREATE TABLE `trademark`  (
  `id` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `company_id` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '公司id',
  `register_no` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '注册号',
  `international_category` smallint(5) NOT NULL COMMENT '国际分类',
  `trade_name` varchar(600) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '商标名',
  `app_date` date DEFAULT NULL COMMENT '申请日期',
  `applicant_cn` varchar(800) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '申请人中文',
  `address_cn` varchar(800) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '申请人地址中文',
  `applicant_other_1` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '共有申请人1',
  `applicant_other_2` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '共有申请人2',
  `applicant_en` varchar(800) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '申请人英文',
  `address_en` varchar(800) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '申请人地址英文',
  `announcemen_issue` int(10) DEFAULT NULL COMMENT '初审公告期号',
  `announcement_date` date DEFAULT NULL COMMENT '初审公告日期',
  `register_issue` int(10) DEFAULT NULL COMMENT '注册公告期号',
  `register_date` date DEFAULT NULL COMMENT '注册公告日期',
  `private_date_start` date DEFAULT NULL COMMENT '专用权期限开始日期',
  `private_date_end` date DEFAULT NULL COMMENT '专用权期限结束日期',
  `agent` varchar(600) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '代理人名称',
  `category` smallint(6) DEFAULT NULL COMMENT '商标类型 0-普通商标 1-特殊商标 2-集体商标 3-证明商标 4-立体商标 5-声音商标',
  `late_specified_date` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '后期指定日期',
  `international_register_date` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '国际注册日期',
  `priority_date` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '优先权日期',
  `color` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '指定颜色',
  `status` smallint(6) DEFAULT 4 COMMENT '商标状态 1:有效；2:无效；3:待审；4:不定  5-未知状态',
  `source` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '商标来源',
  `crawl_time` datetime(0) DEFAULT NULL COMMENT '入库时间',
  `update_time` datetime(0) DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` tinyint(2) NOT NULL DEFAULT 0 COMMENT '0不删除 1删除',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `UNIQUE_INDEX_regno_cls`(`register_no`, `international_category`) USING BTREE,
  INDEX `tm_info_idx_reg_no`(`register_no`) USING BTREE,
  INDEX `tm_name`(`trade_name`(255)) USING BTREE,
  INDEX `agent`(`agent`(255)) USING BTREE,
  INDEX `applicant_cn`(`applicant_cn`(255)) USING BTREE,
  INDEX `index_crawl_time`(`crawl_time`) USING BTREE,
  INDEX `index_update_time`(`update_time`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商标信息' ROW_FORMAT = Dynamic;

